INSERT INTO `hymn` VALUES ('1', '1', 'Lamb of God', '<p>Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description Sample description</p>', '<p>Your only Son <br /> No sin to hide<br /> But You have sent Him,<br /> From Your side<br /> To walk upon this guilty sod<br /> And to become the Lamb of God<br /><br /> Your gift of Love <br /> They crucified <br /> They laughed and scorned him as he died<br /> The humble King <br /> They named a fraud<br /> And sacrificed the Lamb of God<br /><br /> Chorus:<br /> Oh Lamb of God, Sweet lamb of God<br /> I love the Holy Lamb of God<br /> Oh wash me in His precious Blood<br /> My Jesus Christ the Lamb of God<br /><br /> I was so lost I should have died <br /> But You have brought me to Your side<br /> To be led by Your staff and rod<br /> And to be call a lamb of God<br /><br /> Chorus<br /><br /> Oh wash me in His precious Blood<br /> My Jesus Chris the Lamb of God</p>', null, null, '2012-09-04 14:28:34');
